// Header including Navbar, Navlinks, Logo for the whole

import React from 'react'


function Header() {
  return (
    <container className="header-container">
        <ul className="header-">
            <li>HOME</li>
            <li>EXERCICES</li>
            <li>PROJETS</li>
            <li>CONTACT</li>
            <li>PROFIL</li>
        </ul>
    </container>
  )
}

export default Header
